e2f757b1-b386-4f41-b81c-72150abade27	63eb944c-50e6-4db8-ad11-686f86c6134c	{\n  "content": [\n    {\n      "title": "Veo dethroned by Chinese rivals",\n      "content": "Welcome back, Superhuman. OpenAI wants out. A new report suggests its once unshakeable partnership with Microsoft could be in jeopardy. Plus: A surprise video model leaps past Veo 3, and Adobe has a plan to help companies boost their visibility on AI chatbots and browsers.\\n\\nAlso today: Learn how to automate your web browsing with AI, and get the latest AI tools and trending social media posts.\\n\\nTODAY IN AI\\n\\nByteDances Seedance model just claimed the top spot in a popular benchmark.\\n\\n1. Two new video models jump past Veo 3 on major benchmark: Since Googles Veo 3 release last month, its been the undisputed champion of VLMs  even making its way to primetime TV spots and Hollywood-backed short films. But its lead didnt last for long: Artificial Analysiss crowd-sourced leaderboard just ranked ByteDances Seedance 1.0 ahead of Veo across multiple categories. Meanwhile, MiniMax just revealed that a mysterious VLM known as Kangaroo, which beats Veo in image-to-video, is actually a brand-new model called Hailuo 02. The shakeup proves that Chinese AI companies are managing to stay competitive with their US counterparts.\\n\\n2. TikTok unveils new AI video tools: ByteDance just gave marketers an entirely new way to promote their products on TikTok. Advertisers can now generate five-second clips with either text or image prompts, then stitch them together to bring a full product catalog to life. For example, you can upload an image of a car, and then generate a video of it driving through a desert landscape. You can also prompt AI avatars to talk about your product and show it off, or even model your brands clothing.\\n\\n3. Adobe is helping brands brace for AIs search shakeup: Retail sites saw a staggering 3,500% spike in traffic coming from generative AI sources in the past year. But while consumers are quickly embracing chatbot-based shopping, analytics tools have struggled to keep up. Adobes new LLM Optimizer aims to fix that  helping companies track how their content performs across AI platforms. It also boosts discoverability, sort of like SEO for LLMs, so your products are more likely to surface in AI-driven searches."\n    },\n    {\n      "title": "Tiny teams huge payoff",\n      "content": "Welcome back, Superhuman. It might be time to change your password. Researchers claim theyve uncovered one of the largest data hacks ever recorded. If confirmed, itd mean up to 16B of our private credentials from platforms like Google and Apple might be compromised.\\n\\nAlso today: Learn how to generate ChatGPT images in WhatsApp, and get the latest AI tools and trending social media posts.\\n\\nTODAY IN AI\\n\\nMiniMax is going after rivals like OpenAI and Butterfly Effect with a browser-based agent. Source: MiniMax\\n\\n1. You can now try MiniMaxs general agent for yourself: The Alibaba-backed startup is bringing its models reasoning capabilities to the masses. MiniMax Agent lets you spin up coding projects, reports, and slideshows alongside an autonomous AI teammate that seems at least on par with fellow Chinese counterpart Manus. For inspiration, you can scroll down to see what others have created, like a London airspace tracker, a virtual museum tour, and an SEO dashboard  complete with the prompts they used.\\n\\n2. Little-known startup races to fill Scale AI-shaped hole: With Meta purchasing a 49% stake in Scale and major players like OpenAI and Google heading for the door, an obscure startup called Surge AI is stepping out of the shadows as a worthy replacement. Like Scale, the 110-person company labels data for training frontier models. But it brought in $1B last year, fully bootstrapped, while $29B-valued Scale made only $870M in the same period. Surge is just one of a growing number of data-labeling startups that could stand to benefit from the Scale shakeup.\\n\\n3. MIT builds model that can continually teach itself: One thing that separates us from AI is that we have the ability to pick up new information and adjust our worldview accordingly. But that skill might not be exclusive to humans for long. MIT researchers developed a technique called Self Adapting Language Models (SEAL) that lets LLMs adjust their own parameters as they learn. The approach boosted the performance of Metas Llama and Alibabas Qwen, although pushing the models too much can actually lead them to start forgetting things."\n    }\n  ],\n  "ads": [],\n  "mcp_necessity": true,\n  "mcp_response": "Content retrieved successfully.",\n  "mcp_response_type": "text",\n  "mcp_response_id": "1"\n}	f	2025-07-04 19:38:38.509834+00
