not be exclusive to humans for long. MIT researchers developed a technique called Self Adapting Language Models (SEAL) that lets LLMs adjust their own parameters as they learn. The approach boosted the performance of Metas Llama and Alibabas Qwen, although pushing the models too much can actually lead them to start forgetting things."\n      },\n      {\n        "title": "Gemini 2.5 unleashed",\n        "content": "Welcome back, Superhuman. You can now apparently build a lightweight Netflix clone with nothing more than an AI agent and some well-crafted prompts. And: Tech CEOs are finally starting to admit what weve all suspected: AI is coming for some of our jobs  but it might unlock even better opportunities in the process.\\n\\nAlso today: Learn how to create product videos with Higgsfield, and get the latest AI tools, prompts, and trending social media posts.\\n\\nTODAY IN AI\\n\\nAdobe is rolling out a series of new AI-powered updates for Firefly. Source: Adobe\\n\\n1. Google drops major Gemini 2.5 updates: The search giant revealed that Gemini 2.5 Pro, its most powerful model, is now out of preview and all set for developers to build on. The same is true for its smaller sibling, Gemini 2.5 Flash, which is designed for fast all-around help. Finally, a new model called 2.5 Flash-Lite is even speedier while beating its predecessor across math, science, and coding. It can also be assigned different thinking budgets if you want it to take on more complex tasks without jumping to the full Flash model.\\n\\n2. Open-source agent leaps to the front of the pack: Shanghais MiniMax just released a new model called M1 that features an enormous 1M-token context window  theoretically big enough to process an entire collection of books, compared to GPT-4os novel-length limit. It also edges out DeepSeeks R1, despite that model getting a major upgrade only a few weeks ago. And it can supposedly handle everything from building a Netflix clone to whipping up a stock dashboard on its own."\n      }\n    ]\n  },\n  "ads": [],\n  "mcp_necessity": true,\n  "mcp_response": "email marketing strategies",\n  "mcp_response_type": "text",\n  "mcp_response_id": "1"\n}	f	2025-07-04 19:39:30.886603+00
