d6f66c7d-8fbd-4d08-90ca-a6f8df355cc6	55966833-d382-4b13-9c3f-dedcf32e4e45	{\n  "content": [\n    {\n      "title": "Tiny teams huge payoff",\n      "text": "Welcome back, Superhuman. It might be time to change your password. Researchers claim theyve uncovered one of the largest data hacks ever recorded. If confirmed, itd mean up to 16B of our private credentials from platforms like Google and Apple might be compromised.\\n\\nAlso today: Learn how to generate ChatGPT images in WhatsApp, and get the latest AI tools and trending social media posts.\\n\\n**TODAY IN AI**\\n\\nMiniMax is going after rivals like OpenAI and Butterfly Effect with a browser-based agent. Source: MiniMax\\n\\n1. You can now try MiniMaxs general agent for yourself: The Alibaba-backed startup is bringing its models reasoning capabilities to the masses. MiniMax Agent lets you spin up coding projects, reports, and slideshows alongside an autonomous AI teammate that seems at least on par with fellow Chinese counterpart Manus. For inspiration, you can scroll down to see what others have created, like a London airspace tracker, a virtual museum tour, and an SEO dashboard  complete with the prompts they used.\\n\\n2. Little-known startup races to fill Scale AI-shaped hole: With Meta purchasing a 49% stake in Scale and major players like OpenAI and Google heading for the door, an obscure startup called Surge AI is stepping out of the shadows as a worthy replacement. Like Scale, the 110-person company labels data for training frontier models. But it brought in $1B last year, fully bootstrapped, while $29B-valued Scale made only $870M in the same period. Surge is just one of a growing number of data-labeling startups that could stand to benefit from the Scale shakeup.\\n\\n3. MIT builds model that can continually teach itself: One thing that separates us from AI is that we have the ability to pick up new information and adjust our worldview accordingly. But that skill might not be exclusive to humans for long. MIT researchers developed a technique called Self Adapting Language Models (SEAL) that lets LLMs adjust their own parameters as they learn. The approach boosted the performance of Metas Llama and Alibabas Qwen, although pushing the models too much can actually lead them to start forgetting things.\\n\\n**FROM THE FRONTIER**\\nAI is fueling a solopreneur boom\\n\\nAI is getting so good, it can now replace real-life hosts. Source: CNBC/Screenshot\\n\\nA solo developer just sold his six-month-old side-project for $80M: Maor Shlomos vibe-coding platform Base44, which helps non-programmers design their own software, was acquired by Wix as it looks to add more AI features to its website-building platform.\\n\\nWhile Shlomos startup didnt stay solo for long (it eventually grew to include nine employees in total), its rate of growth and profitability, generating $189,000 of profit in May alone, would have been unheard of even a couple of years ago.\\n\\nAnother surprising application: Two AI avatars, trained on a real-life influencer and his co-host in China, just raised $7.65M in just seven hours via a livestream where they showed off different products. Thats allegedly more than the real-life hosts had managed during previous streams.\\n\\nThe big takeaway: AI is making startups smaller and smaller, as founders start to hand off increasingly complex tasks to agents. Its to the point where a solo unicorn  a single-person startup with at least a $1B valuation  doesnt sound quite so far-fetched anymore. To keep up, bigger corporations will need to carve out small, nimble teams where employees can experiment and put AI to use in unexpected ways.\\n\\n**AI ACADEMY**\\nHow to generate ChatGPT images in WhatsApp\\n\\nOpen WhatsApp on your phone.\\n\\nSend the message Link my WhatsApp with ChatGPT to 1-800-ChatGPT.\\n\\nYoull receive a linktap it to connect your WhatsApp with your ChatGPT account\\n\\nNow you can prompt ChatGPT within WhatsApp to generate images for you.\\n\\nSample Prompt: Can you create me a white fluffy cat made of rice wrapped in a strip of seaweed around its stomach\\n\\nWait a few seconds, and ChatGPT will generate an image for you.\\n\\n**IN THE KNOW**\\nWhats trending on socials and headlines today\\n\\nWatch what happened when a UCLA graduate showed off all his ChatGPT-generated final projects during his graduation ceremony.\\n\\n Masterful Move: Duolingo built a full chess course from scratch with just two employees and the AI coding tool Cursor. Heres how.\\n\\n Mother Lode: This mega-thread of X users sharing their coolest model context protocol (MCP) integrations is a goldmine of good ideas.\\n\\n The Plot Thickens: Are all LLMs converging around the same personality and responses? OpenAI cofounder Andrej Karpathy is on the case.\\n\\n Paper Trail: Two nonprofits just released a huge trove of documents that supposedly reveal some of OpenAIs biggest secrets. Podcast host Rob Wiblin rounded up the most shocking details, although skeptics are already calling them into question.\\n\\nOpenAI is rolling out Record Mode, which can transcribe and summarize your meetings and thoughts, for all Pro, Enterprise, and Edu users.\\n\\nPerplexity will now let you generate videos with text prompts when you tag @AskPerplexity on X. Heres a thread with some user-submitted examples.\\n\\nResearchers at OpenAI say theyve spotted certain internal patterns similar to brain activity that flare up before a model misbehaves  a breakthrough that could help us build safer LLMs in the future.\\n\\n**PROMPT STATION**\\nLinkedIn Profile Optimizer\\nPrompt: <Role>\\nYou are a top LinkedIn Profile Strategist who helps professionals turn average profiles into powerful tools for career growth, visibility, and credibility. <Role>\\n\\n<Context>\\nWith 95% of recruiters using LinkedIn and just 715 seconds spent scanning a profile, a strong profile can unlock major opportunities. Most professionals fail to stand out or clearly communicate their value. <Context>\\n\\n<Instructions> Ask the user to share:\\nCurrent headline\\nAbout/summary section\\nExperience descriptions\\nSkills section\\nRecent content/activity\\nCurrent goals\\nTarget audience (recruiters, clients, peers, etc.)\\n\\nThen, perform a detailed audit and provide:\\nHeadline Transformation  3 keyword-optimized, high-impact alternatives\\nSummary Rewrite  Rewritten using the HookStoryOffer framework\\nExperience Entry Fix  Convert one duty-based entry into a results-driven version\\nSkills & Endorsements  Optimization strategy for relevance and credibility\\nContent Strategy  30-day calendar with 5 viral post ideas\\n\\nAlso include:\\nImplementation Priority Guide  Steps in order of impact\\nPerformance Metrics  Track views, search appearances, and engagement <Instructions>\\n\\n<Constraints> Keep suggestions tailored, actionable, and authentic. Avoid vague advice or unrealistic claims. Dont request private info beyond LinkedIn content. <Constraints>\\n\\n<Output_Format>\\nLINKEDIN PROFILE AUDIT\\n\\nCurrent Profile Strengths\\nCritical Improvement Areas\\nStrategic Recommendations (items 15 above)\\nImplementation Priority Guide\\nPerformance Measurement <Output_Format>\\n\\n<User_Input> Ask the user for the 7 LinkedIn details listed above before starting your audit. <User_Input>"\n    },\n    {\n      "title": "Veo dethroned by Chinese rivals",\n      "text": "Welcome back, Superhuman. OpenAI wants out. A new report suggests its once unshakeable partnership with Microsoft could be in jeopardy. Plus: A surprise video model leaps past Veo 3, and Adobe has a plan to help companies boost their visibility on AI chatbots and browsers.\\n\\nAlso today: Learn how to automate your web browsing with AI, and get the latest AI tools and trending social media posts.\\n\\n**TODAY IN AI**\\n\\nByteDances Seedance model just claimed the top spot in a popular benchmark.\\n\\n1. Two new video models jump past Veo 3 on major benchmark: Since Googles Veo 3 release last month, its been the undisputed champion of VLMs  even making its way to primetime TV spots and Hollywood-backed short films. But its lead didnt last for long: Artificial Analysiss crowd-sourced leaderboard just ranked ByteDances Seedance 1.0 ahead of Veo across multiple categories. Meanwhile, MiniMax just revealed that a mysterious VLM known as Kangaroo, which beats Veo in image-to-video, is actually a brand-new model called Hailuo 02. The shakeup proves that Chinese AI companies are managing to stay competitive with their US counterparts.\\n\\n2. TikTok unveils new AI video tools: ByteDance just gave marketers an entirely new way to promote their products on TikTok. Advertisers can now generate five-second clips with either text or image prompts, then stitch them together to bring a full product catalog to life. For example, you can upload an image of a car, and then generate a video of it driving through a desert landscape. You can also prompt AI avatars to talk about your product and show it off, or even model your brands clothing.\\n\\n3. Adobe is helping brands brace for AIs search shakeup: Retail sites saw a staggering 3,500% spike in traffic coming from generative AI sources in the past year. But while consumers are quickly embracing chatbot-based shopping, analytics tools have struggled to keep up. Adobes new LLM Optimizer aims to fix that  helping companies track how their content performs across AI platforms. It also boosts discoverability, sort of like SEO for LLMs, so your products are more likely to surface in AI-driven searches.\\n\\n**FROM THE FRONTIER**\\nReport: Microsoft and OpenAI face a bitter breakup\\n\\nOpenAI and Microsofts close relationship could be souring. Source: Analytics India Magazine\\n\\nIt looks like Microsoft and OpenAIs six-year partnership  one of the closest collaborations in the industry  might have finally reached a tipping point.\\n\\nIt was a match made in heaven: As far back as 2019, Microsoft has been giving OpenAI cloud access and billions in investments in exchange for exclusive rights to the ChatGPT-makers models. But now that OpenAI has become a massively successful tech company in its own right, it wants more independence and flexibility.\\n\\nHow so? OpenAI has been trying for months to transform into a public-benefit corporation, giving it a chance to turn a profit and accelerate its growth. The one thing holding it back: Microsoft wont budge on the details out of fear itll get burned in the process.\\n\\nHigh Stakes: According to the Wall Street Journal, the feud has gotten so heated that OpenAI is now considering going public with its accusations. It could also ask the federal government to investigate Microsoft for antitrust violations.\\n\\nNot so fast: In a joint statement, both companies agreed theyre optimistic we will continue to build together for years to come, hinting that there might still be time to smooth things over.\\n\\n**AI & TECH NEWS**\\nEverything else you need to know today\\n\\nA team of researchers used GPT-4.1 and o3-mini-high to shave off years of research time. Source: Imagen\\n\\n Hype Train: Reddit launched a pair of AI tools that let advertisers track whats trending in different subreddits and test-drive new campaigns before rolling them out on the platform.\\n\\n Data Dash: Researchers from Harvard, MIT, and other institutions reportedly saved the equivalent of 12 years of work by using OpenAIs GPT-4.1 and o3-mini-high to automate a systematic review of medical research.\\n\\n Price of Progress: Meta is bringing ads to WhatsApps Updates tab, which gets around 1.5B visitors per day, as the social media giant races to recoup the $14.3B it recently invested in Scale AI.\\n\\n Missing Link: ElevenLabs now supports MCP (model context protocol), meaning you can now build voice agents that connect to Salesforce, HubSpot, and Gmail without any setup.\\n\\n**SOCIAL SIGNALS**\\nWhats trending on socials today\\n\\nClick to see how a Redditor created a concept for a Ghibli-style video game.\\n\\n Takes a Village: Anthropic just revealed how it built its own multi-agent research system, which beat single agents by up to 90%+ on some complex tasks. AI builder Elvis Saravia has some highlights if you dont have time to read the whole thing.\\n\\n Cold-Blooded Content: A viral post claims Anthropic is sponsoring an albino alligator named Claude at the California Academy of Sciences. Theres even a livestream where you can watch Claude as he lounges, swims, and snoozes in his swamp.\\n\\n Sound of Success: Clever TikTok users are allegedly racking up tens of millions of followers by creating ASMR videos  like slicing through glass fruits and molten lava  using Veo 3s new native audio features.\\n\\n Beyond Buzzwords: LinkedIn cofounder Reid Hoffman just shared his advice for how to prepare for the AI wave, beyond just learning how to prompt engineer and vibe-code.\\n\\n**PROMPT STATION**\\nSimplify and summarize long articles\\nPrompt: You are a reading assistant. The user will provide you with an article to read. Please thoroughly read the article and generate a guide and a simplified, easy-to-read version of the article with the following requirements:\\n\\n## Your output:\\n\\nMind Map: First, generate a mind map for the entire guide.\\n\\nSummary: Next, provide a summary of the entire text, limited to 400 words.\\n\\nSimplified Article: Then, present your rewritten simplified and easy-to-read version of the article.\\n\\n## Requirements for Rewriting:\\n\\nWord Count: Compress the word count to half of the original, and ensure it does not exceed 3,000 words.\\n\\nAuthors Tone: Simulate the original author's tone.\\n\\nStructure: Maintain the original structure, retaining all levels of headings.\\n\\nFormatting: Format the output to ensure a visually appealing layout and ease of reading.\\n\\nVisual Elements: Insert tables, charts, diagrams, SVGs, and other visual elements in appropriate places to enhance readability.\\n\\nSource: r/ChatGPTPromptGenius"\n    }\n  ],\n  "ads": [],\n  "mcp_necessity": true,\n  "mcp_response": null,\n  "mcp_response_type": null,\n  "mcp_response_id": null\n}	f	2025-07-04 19:39:33.388796+00
