 AI chatbots and browsers.\\n\\nAlso today: Learn how to automate your web browsing with AI, and get the latest AI tools and trending social media posts.\\n\\n**TODAY IN AI**\\n\\nByteDances Seedance model just claimed the top spot in a popular benchmark.\\n\\n1. Two new video models jump past Veo 3 on major benchmark: Since Googles Veo 3 release last month, its been the undisputed champion of VLMs  even making its way to primetime TV spots and Hollywood-backed short films. But its lead didnt last for long: Artificial Analysiss crowd-sourced leaderboard just ranked ByteDances Seedance 1.0 ahead of Veo across multiple categories. Meanwhile, MiniMax just revealed that a mysterious VLM known as Kangaroo, which beats Veo in image-to-video, is actually a brand-new model called Hailuo 02. The shakeup proves that Chinese AI companies are managing to stay competitive with their US counterparts.\\n\\n2. TikTok unveils new AI video tools: ByteDance just gave marketers an entirely new way to promote their products on TikTok. Advertisers can now generate five-second clips with either text or image prompts, then stitch them together to bring a full product catalog to life. For example, you can upload an image of a car, and then generate a video of it driving through a desert landscape. You can also prompt AI avatars to talk about your product and show it off, or even model your brands clothing.\\n\\n3. Adobe is helping brands brace for AIs search shakeup: Retail sites saw a staggering 3,500% spike in traffic coming from generative AI sources in the past year. But while consumers are quickly embracing chatbot-based shopping, analytics tools have struggled to keep up. Adobes new LLM Optimizer aims to fix that  helping companies track how their content performs across AI platforms. It also boosts discoverability, sort of like SEO for LLMs, so your products are more likely to surface in AI-driven searches."\n    },\n    {\n      "title": "Gemini 2.5 unleashed",\n      "text": "Welco