 newcomers from Luma, Runway, and Ideogram, as well as staples from Google and OpenAI."\n    }\n  ],\n  "ads": [],\n  "mcp_necessity": true,\n  "mcp_response": "Marketing tools for business",\n  "mcp_response_type": "text",\n  "mcp_response_id": "1"\n}	f	2025-07-04 19:46:13.623074+00
