14bf810e-3a81-41cd-a5da-29c867241c94	0f2d251e-e881-4597-8fae-1209690edc79	{\n  "content": [\n    {\n      "title": "Tiny teams huge payoff",\n      "text": "Welcome back, Superhuman. It might be time to change your password. Researchers claim theyve uncovered one of the largest data hacks ever recorded. If confirmed, itd mean up to 16B of our private credentials from platforms like Google and Apple might be compromised.\\n\\nAlso today: Learn how to generate ChatGPT images in WhatsApp, and get the latest AI tools and trending social media posts.\\n\\n**TODAY IN AI**\\n\\nMiniMax is going after rivals like OpenAI and Butterfly Effect with a browser-based agent. Source: MiniMax\\n\\n1. You can now try MiniMaxs general agent for yourself: The Alibaba-backed startup is bringing its models reasoning capabilities to the masses. MiniMax Agent lets you spin up coding projects, reports, and slideshows alongside an autonomous AI teammate that seems at least on par with fellow Chinese counterpart Manus. For inspiration, you can scroll down to see what others have created, like a London airspace tracker, a virtual museum tour, and an SEO dashboard  complete with the prompts they used.\\n\\n2. Little-known startup races to fill Scale AI-shaped hole: With Meta purchasing a 49% stake in Scale and major players like OpenAI and Google heading for the door, an obscure startup called Surge AI is stepping out of the shadows as a worthy replacement. Like Scale, the 110-person company labels data for training frontier models. But it brought in $1B last year, fully bootstrapped, while $29B-valued Scale made only $870M in the same period. Surge is just one of a growing number of data-labeling startups that could stand to benefit from the Scale shakeup.\\n\\n3. MIT builds model that can continually teach itself: One thing that separates us from AI is that we have the ability to pick up new information and adjust our worldview accordingly. But that skill might not be exclusive to humans for long. MIT researchers developed a technique called Self Adapting Language Models (SEAL) that lets LLMs adjust their own parameters as they learn. The approach boosted the performance of Metas Llama and Alibabas Qwen, although pushing the models too much can actually lead them to start forgetting things.\\n\\n**FROM THE FRONTIER**\\nAI is fueling a solopreneur boom\\n\\nAI is getting so good, it can now replace real-life hosts. Source: CNBC/Screenshot\\n\\nA solo developer just sold his six-month-old side-project for $80M: Maor Shlomos vibe-coding platform Base44, which helps non-programmers design their own software, was acquired by Wix as it looks to add more AI features to its website-building platform.\\n\\nWhile Shlomos startup didnt stay solo for long (it eventually grew to include nine employees in total), its rate of growth and profitability, generating $189,000 of profit in May alone, would have been unheard of even a couple of years ago.\\n\\nAnother surprising application: Two AI avatars, trained on a real-life influencer and his co-host in China, just raised $7.65M in just seven hours via a livestream where they showed off different products. Thats allegedly more than the real-life hosts had managed during previous streams.\\n\\nThe big takeaway: AI is making startups smaller and smaller, as founders start to hand off increasingly complex tasks to agents. Its to the point where a solo unicorn  a single-person startup with at least a $1B valuation  doesnt sound quite so far-fetched anymore. To keep up, bigger corporations will need to carve out small, nimble teams where employees can experiment and put AI to use in unexpected ways."\n    },\n    {\n      "title": "Veo dethroned by Chinese rivals",\n      "text": "Welcome back, Superhuman. OpenAI wants out. A new report suggests its once unshakeable partnership with Microsoft could be in jeopardy. Plus: A surprise video model leaps past Veo 3, and Adobe has a plan to help companies boost their visibility on AI chatbots and browsers.\\n\\nAlso today: Learn how to automate your web browsing with AI, and get the latest AI tools and trending social media posts.\\n\\n**TODAY IN AI**\\n\\nByteDances Seedance model just claimed the top spot in a popular benchmark.\\n\\n1. Two new video models jump past Veo 3 on major benchmark: Since Googles Veo 3 release last month, its been the undisputed champion of VLMs  even making its way to primetime TV spots and Hollywood-backed short films. But its lead didnt last for long: Artificial Analysiss crowd-sourced leaderboard just ranked ByteDances Seedance 1.0 ahead of Veo across multiple categories. Meanwhile, MiniMax just revealed that a mysterious VLM known as Kangaroo, which beats Veo in image-to-video, is actually a brand-new model called Hailuo 02. The shakeup proves that Chinese AI companies are managing to stay competitive with their US counterparts.\\n\\n2. TikTok unveils new AI video tools: ByteDance just gave marketers an entirely new way to promote their products on TikTok. Advertisers can now generate five-second clips with either text or image prompts, then stitch them together to bring a full product catalog to life. For example, you can upload an image of a car, and then generate a video of it driving through a desert landscape. You can also prompt AI avatars to talk about your product and show it off, or even model your brands clothing.\\n\\n3. Adobe is helping brands brace for AIs search shakeup: Retail sites saw a staggering 3,500% spike in traffic coming from generative AI sources in the past year. But while consumers are quickly embracing chatbot-based shopping, analytics tools have struggled to keep up. Adobes new LLM Optimizer aims to fix that  helping companies track how their content performs across AI platforms. It also boosts discoverability, sort of like SEO for LLMs, so your products are more likely to surface in AI-driven searches."\n    },\n    {\n      "title": "Gemini 2.5 unleashed",\n      "text": "Welcome back, Superhuman. You can now apparently build a lightweight Netflix clone with nothing more than an AI agent and some well-crafted prompts. And: Tech CEOs are finally starting to admit what weve all suspected: AI is coming for some of our jobs  but it might unlock even better opportunities in the process.\\n\\nAlso today: Learn how to create product videos with Higgsfield, and get the latest AI tools, prompts, and trending social media posts.\\n\\n**TODAY IN AI**\\n\\nAdobe is rolling out a series of new AI-powered updates for Firefly. Source: Adobe\\n\\n1. Google drops major Gemini 2.5 updates: The search giant revealed that Gemini 2.5 Pro, its most powerful model, is now out of preview and all set for developers to build on. The same is true for its smaller sibling, Gemini 2.5 Flash, which is designed for fast all-around help. Finally, a new model called 2.5 Flash-Lite is even speedier while beating its predecessor across math, science, and coding. It can also be assigned different thinking budgets if you want it to take on more complex tasks without jumping to the full Flash model.\\n\\n2. Open-source agent leaps to the front of the pack: Shanghais MiniMax just released a new model called M1 that features an enormous 1M-token context window  theoretically big enough to process an entire collection of books, compared to GPT-4os novel-length limit. It also edges out DeepSeeks R1, despite that model getting a major upgrade only a few weeks ago. And it can supposedly handle everything from building a Netflix clone to whipping up a stock dashboard on its own.\\n\\n3. New mobile app unlocks on-the-go video generations: Adobe just unveiled a mobile version of Firefly, its commercially-safe image and video generation platform. Its also rolling out Boards, an AI-powered digital mood board that can help you piece together creative ideas  now with video-gen folded in. Plus, you can access just about every major third-party video and image model inside Firefly, including newcomers from Luma, Runway, and Ideogram, as well as staples from Google and OpenAI."\n    }\n  ],\n  "ads": [],\n  "mcp_necessity": true,\n  "mcp_response": "Marketing tools for business",\n  "mcp_response_type": "text",\n  "mcp_response_id": "1"\n}	f	2025-07-04 19:56:53.199004+00
