manoid robot that they claim successfully hovered to about 50cm off the ground during its first test flight. Not exactly breaking altitude records, but still a significant leap. Unlike traditional drones, the robot must balance an entire humanoid body with movable limbs while adapting to complex, ever-changing aerodynamics. See it in action here.\\n\\nROBOTS IN ACTION\\nHow robots are transforming the world around us\\n\\nDr. Kenneth Liao performs the first successful, fully robotic heart transplant in the US. Source: Baylor College of Medicine\\n\\nHeart Hack: Houston surgeons have performed the first fully robotic heart transplant in the US without cracking open the patient's chest. Instead of the traditional method of breaking the breastbone, doctors made small incisions in the abdomen, using robotic tools to remove the diseased heart and implant a donor organ.\\n\\nGas Guardian: A single undetected gas leak can cost facilities over $57,000 per year and pose a major safety risk in petrochemical plants. Now, Swiss robotics company ANYbotics has equipped its ANYmal robot with gas leak detection capabilities, enabling the quadruped to pinpoint invisible leaks that manual inspections often miss.\\n\\nBlade Runner: KUKA has unveiled the Catonator, a remote-controlled robotic saw armed with 2,000mm blades that can slice through steel, concrete, and aerospace composites with 0.1mm precision. It could potentially automate precision cutting tasks while eliminating emissions and improving worker safety in heavy industry applications.\\n\\nINDUSTRY SNAPSHOT\\nEverything else you need to know this week\\n\\nSource: Reuters\\n\\nHere are the biggest developments in the robotics space that you should know about:\\n\\nTesla has been asked by Democratic lawmakers to put off its robotaxi launch until September, when new regulations with stricter state oversight take effect.\\n\\nAnduril is joining hands with German giant Rheinmetall to build military drones for European markets  a shift toward faster innovation in European defense.\\n\\nA recent Gallup poll shows that 15% of US workers believe that AI or robots may likely replace their jobs.\\n\\nAmazon's Zoox just opened its first production facility in Hayward, California, where it eventually expects to build over 10,000 electric AVs annually.\\n\\nEngineAI has open-sourced a dev suite designed to accelerate humanoid robot creation by removing technical barriers for startups and researchers.\\n\\nUS startup Skydweller Aero has partnered up with French defense company Thales to deploy a solar-powered drone that can stay in flight for a whole month.\\n\\nPrismaX has launched with $11M to solve one of the biggest bottlenecks in robotics  a lack of high-quality training data for AI models.\\n\\nROBOT OF THE WEEK\\nA robot that caught our eye this week\\n\\nSource: Beatbot\\n\\nBeatbots AquaSense 2 is making waves as a Roomba for your swimming pool.\\n\\nThe robotic pool cleaner uses HybridSense AI mapping, 27 sensors, and 11 motors to clean floors, walls, waterlines, and the water surface automatically while also offering water clarification. It can take on pools up to 3,875 square feet and runs for up to 10 hours on a single charge for surface cleaning.\\n\\nYou can check it out here.\\n\\nROBO REEL\\nWatch: Inventor builds real-life Transformer that shape-shifts into a ride\\n\\nBruton's robot is a feat of practical engineering, designed with eagle-eyed detail. Source: James Bruton / YouTube\\n\\nIt was only a matter of time.\\n\\nIn what was every 90s kids childhood dream, British inventor James Bruton has built a rideable Transformer robot that actually shape-shifts from humanoid to vehicle. Unlike other transformer projects that leave no room for passengers, Bruton's creation can carry a human rider at functional speeds."\n    },\n    {\n      "title": "Gemini 2.5 unleashed",\n      "content": "Welcome back, Superhuman. You can now apparently build a lightweight Netflix clone with nothing more than an AI agent and some well-crafted prompts. And: Tech CEOs are finally starting to admit what weve all suspected: AI is coming for some of our jobs  but it might unlock even better opportunities in the process.\\n\\nAlso today: Learn how to create product videos with Higgsfield, and get the latest AI tools, prompts, and trending social media posts.\\n\\nTODAY IN AI\\n\\nAdobe is rolling out a series of new AI-powered updates for Firefly. Source: Adobe\\n\\n1. Google drops major Gemini 2.5 updates: The search giant revealed that Gemini 2.5 Pro, its most powerful model, is now out of preview and all set for developers to build on. The same is true for its smaller sibling, Gemini 2.5 Flash, which is designed for fast all-around help. Finally, a new model called 2.5 Flash-Lite is even speedier while beating its predecessor across math, science, and coding. It can also be assigned different thinking budgets if you want it to take on more complex tasks without jumping to the full Flash model.\\n\\n2. Open-source agent leaps to the front of the pack: Shanghais MiniMax just released a new model called M1 that features an enormous 1M-token context window  theoretically big enough to process an entire collection of books, compared to GPT-4os novel-length limit. It also edges out DeepSeeks R1, despite that model getting a major upgrade only a few weeks ago. And it can supposedly handle everything from building a Netflix clone to whipping up a stock dashboard on its own.\\n\\n3. New mobile app unlocks on-the-go video generations: Adobe just unveiled a mobile version of Firefly, its commercially-safe image and video generation platform. Its also rolling out Boards, an AI-powered digital mood board that can help you piece together creative ideas  now with video-gen folded in. Plus, you can access just about every major third-party video and image model inside Firefly, including newcomers from Luma, Runway, and Ideogram, as well as staples from Google and OpenAI.\\n\\nFROM THE FRONTIER\\nAI is already reshaping the workplace\\n\\nNearly 20% of American workers use AI on a frequent basis. Source: Gallup\\n\\nThe USs second-largest employer just dropped the hammer. In a new memo to his 1.5M+ employees, Amazon CEO Andy Jassy revealed that the company will likely see some job cuts in the near future as generative AI floods virtually every corner of the company.\\n\\nBut its not as grim as it sounds: Jassy said that while some positions are bound to be automated, other types of jobs will open up. Some of the best ways to prepare: Be curious about AI, educate yourself, attend workshops and take trainings, use and experiment with AI whenever you can, participate in your teams brainstorms.\\n\\nA new Gallup poll suggests many of us are already well on our way: About 40% of American employees have used AI at least a few times in the past year, up from just 21% the year before. Meanwhile, nearly one in five employees count themselves as frequent AI users, relying on LLMs at least a few times a week for work. (A new Microsoft report has some tips to help ease the transition.)\\n\\nWhat it means: In the past few months, weve finally seen CEOs be more upfront about AIs impact on jobs. While that transparency can be daunting, its also an exciting time for the workforce. We have an active role in reshaping our daily workflows and can proactively create the jobs we envision.\\n\\nAI & TECH NEWS\\nEverything else you need to know today\\n\\nKreas new image model breaks new ground in the photorealism department. Source: Krea\\n\\n Sharper Image: AI creator platform Krea is giving everyone access to its new image model, Krea 1, which can generate photorealistic shots while avoiding the typical AI look that affects its competitors. You can try it here.\\n\\n Ultra Upsell: Cursor unveiled a new $200/month Ultra plan that gives power users 20x the usage of its $20/month Pro tier. The move could help parent company Anysphere boost revenue following its $9.9B valuation earlier this month.\\n\\n Text to Image: You can now generate images by sending a prompt to 1-800-ChatGPT inside WhatsApp. Plus, OpenAI is bringing reusable prompts to the API, letting you easily reuse, share, save, and manage your prompts  or even optimize them with the click of a button.\\n\\n Clear Vision: Meta and glasses-maker EssilorLuxottica are teaming up with Oakley and Prada to create spin-offs of their AI-powered smart glasses. Oakleys version will reportedly cost $360, featuring new weather resistance upgrades, while the Prada variant is still under wraps."\n    }\n  ],\n  "ads": [],\n  "mcp_necessity": true,\n  "mcp_response": "success",\n  "mcp_response_type": "content",\n  "mcp_response_id": "1"\n}	f	2025-07-04 20:24:03.819952+00
