4cd3c5b8-3b61-4a63-8bca-cfcf136a4283	5c168ec5-6525-4ecc-9908-10734a409e47	{\n  "content": "Here are the latest creator content highlights and ads:\\n\\n**Creator Content:**\\n\\n1. **Midjourney video model is finally here**\\n   - Midjourney launches its first AI video generation model (V1), letting users turn images into video clips. Its affordable at $10/month and offers unique video styles. Also, Sam Altman teases GPT-5 for this summer, and Meta is aggressively recruiting AI talent. \\n   - Trending: MITs study on ChatGPTs effect on student brains, a viral ChatGPT prompt to reduce hallucinations, and Googles new Search Live AI feature.\\n\\n2. **Tiny teams, huge payoff**\\n   - MiniMax releases a browser-based AI agent for coding and reports. Surge AI, a small data-labeling startup, is rising as Scale AIs replacement. MITs SEAL technique lets LLMs self-adapt. \\n   - AI is fueling a solopreneur boom: a solo developer sold his side project for $80M, and AI avatars in China raised $7.65M in hours. \\n   - How-to: Generate ChatGPT images in WhatsApp by linking your account and prompting image requests.\\n\\n3. **Veo dethroned by Chinese rivals**\\n   - ByteDances Seedance and MiniMaxs Hailuo 02 surpass Googles Veo 3 in video benchmarks. TikTok unveils new AI video tools for marketers. Adobe launches LLM Optimizer for AI search visibility. \\n   - Microsoft and OpenAIs partnership may be souring, with OpenAI seeking more independence. \\n   - Trending: Anthropics multi-agent system, LinkedIn cofounder Reid Hoffmans AI advice, and a viral Ghibli-style game concept.\\n\\n**Prompt Station:**\\n- LinkedIn Profile Optimizer: Share your LinkedIn details for a tailored audit and actionable recommendations.\\n- Simplify and summarize long articles: Provide an article for a mind map, summary, and easy-to-read rewrite.\\n\\n**Ads & Sponsored Content:**\\n\\n1. **Gemini 2.5 unleashed**\\n   - Googles Gemini 2.5 Pro and Flash models are now available for developers, with Flash-Lite offering even faster performance. \\n   - Shanghais MiniMax M1 model boasts a 1M-token context window, outpacing DeepSeeks R1. \\n   - Adobes Firefly now has a mobile app for on-the-go image and video generation.\\n\\n2. **AI reshaping the workplace**\\n   - Amazon CEO Andy Jassy warns of job cuts as AI automates more roles, but new opportunities are emerging. 40% of US employees have used AI in the past year, with 20% as frequent users.\\n   - Kreas new image model offers photorealistic shots, Cursor launches a $200/month Ultra plan, and Meta teams up with Oakley and Prada for AI-powered smart glasses.",\n  "ads": [\n    {\n      "title": "Gemini 2.5 unleashed",\n      "content": "Googles Gemini 2.5 Pro and Flash models are now available for developers, with Flash-Lite offering even faster performance. Try the new Gemini models for advanced AI capabilities.",\n      "url": null\n    },\n    {\n      "title": "Adobe Firefly Mobile",\n      "content": "Create images and videos on the go with Adobes new Firefly mobile app. Now with support for third-party models from Luma, Runway, and more.",\n      "url": null\n    },\n    {\n      "title": "Meta Smart Glasses",\n      "content": "Meta and EssilorLuxottica are launching new AI-powered smart glasses with Oakley and Prada. Stay tuned for the latest in wearable AI tech.",\n      "url": null\n    }\n  ],\n  "mcp_necessity": true,\n  "mcp_response": "[{\\"query\\": \\"creator content\\",\\"ads\\": [],\\"content\\": [{\\"title\\": \\"Midjourney video model is finally here\\",\\"url\\": null,\\"content\\": \\"Welcome back, Superhuman. It\\\\u2019s finally here. If you\\\\u2019ve been dabbling in AI image generation since the early days, you probably know that Midjourney is a fan favorite. But other AI labs have beaten Midjourney to video models over the last year. The company\\\\u2019s long-awaited video model is here at long last \\\\u2014 and packs a serious punch.\\\\n\\\\nAlso: Sam Altman makes some big allegations, Meta continues its spending splurge, and learn how to find hidden insights with today\\\\u2019s prompt.\\\\n\\\\nTODAY IN AI\\\\n\\\\nClick here to watch Midjourney\\\\u2019s new video generation model V1 in action. Source: Midjourney\\\\n\\\\n1. Midjourney launches its first AI video generation model: The startup just dropped V1, which lets you turn any image into a set of 4 five-second video clips. The model can extend clips up to 21 seconds and allows users to tweak camera movement and animation styles. At $10/month, it\\\\u2019s significantly cheaper than other video generation models in the space, and according to Wharton professor Ethan Mollick, it can generate video styles that are hard to achieve with other video creation tools.\\\\n\\\\n2. Sam Altman drops GPT-5 timeline: In a podcast interview, the OpenAI CEO shared that GPT-5 is coming \\\\u201cprobably sometime this summer.\\\\u201c The model is expected to come with enhanced reasoning and agentic capabilities. Altman also alleged that Elon Musk tried to use his influence in government to compete unfairly against OpenAI. In a separate interview, Altman also claimed that Meta is offering OpenAI\\\\u2019s top employees $100M bonuses to lure them away.\\\\n\\\\n3. Meta reportedly continues its aggressive talent acquisition spree: Not to be deterred by allegations of $100M pay packages, the social media giant is reportedly courting former GitHub CEO Nat Friedman and investor Daniel Gross to join its leadership team. Meta may also potentially buy out part of their venture fund NFDG. The duo has backed major AI startups like Perplexity, Eleven Labs, and Safe Superintelligence.\\\\n\\\\nIN THE KNOW\\\\nWhat\\\\u2019s trending on socials and headlines today\\\\n\\\\n\\\\ud83e\\\\udde0 Brain Drain: MIT just ran a study that measures the effects of ChatGPT on student brains and the results don\\\\u2019t look great.\\\\n\\\\n\\\\u2728 Reality Check: Someone asked ChatGPT the top 10 things humanity should know and put the chatbot\\\\u2019s response up on Reddit in a post that has since blown up.\\\\n\\\\n\\\\u270d\\\\ufe0f Reality Filter: A ChatGPT and Gemini user claims to have created a prompt that stops these chatbots from hallucinating and gaslighting you.\\\\n\\\\n\\\\ud83d\\\\udca1 Builders Delight: Andrej Karpathy's keynote at YC\\\\u2019s AI Startup School is blowing up. It\\\\u2019s a must-watch if you\\\\u2019re building with AI.\\\\n\\\\nGoogle just dropped a new \\\\u201cSearch Live\\\\u201d feature for its AI mode, letting you hold full conversations and chat back and forth with search results. Users can now ask follow-up questions out loud and get AI-generated audio responses in return.\\\\n\\\\nHiggsfield AI launched Canvas, a new image editing model that lets users paint products directly onto photos. Handy for marketers, designers, and creators.\\\\n\\\\nOpenAI is rolling out \\\\\\"Record Mode\\\\\\" for ChatGPT Pro users, allowing you to record, transcribe, and summarize your meetings. The feature is available on the macOS desktop app.\\\\n\\\\n\\"},{\\"title\\": \\"Tiny teams huge payoff\\",\\"url\\": null,\\"content\\": \\"Welcome back, Superhuman. It might be time to change your password. Researchers claim they\\\\u2019ve uncovered one of the largest data hacks ever recorded. If confirmed, it\\\\u2019d mean up to 16B of our private credentials from platforms like Google and Apple might be compromised.\\\\n\\\\nAlso today: Learn how to generate ChatGPT images in WhatsApp, and get the latest AI tools and trending social media posts.\\\\n\\\\nTODAY IN AI\\\\n\\\\nMiniMax is going after rivals like OpenAI and Butterfly Effect with a browser-based agent. Source: MiniMax\\\\n\\\\n1. You can now try MiniMax\\\\u2019s general agent for yourself: The Alibaba-backed startup is bringing its models\\\\u2019 reasoning capabilities to the masses. MiniMax Agent lets you spin up coding projects, reports, and slideshows alongside an autonomous AI teammate that seems at least on par with fellow Chinese counterpart Manus. For inspiration, you can scroll down to see what others have created, like a London airspace tracker, a virtual museum tour, and an SEO dashboard \\\\u2014 complete with the prompts they used.\\\\n\\\\n2. Little-known startup races to fill Scale AI-shaped hole: With Meta purchasing a 49% stake in Scale and major players like OpenAI and Google heading for the door, an obscure startup called Surge AI is stepping out of the shadows as a worthy replacement. Like Scale, the 110-person company labels data for training frontier models. But it brought in $1B last year, fully bootstrapped, while $29B-valued Scale made only $870M in the same period. Surge is just one of a growing number of data-labeling startups that could stand to benefit from the Scale shakeup.\\\\n\\\\n3. MIT builds model that can continually teach itself: One thing that separates us from AI is that we have the ability to pick up new information and adjust our worldview accordingly. But that skill might not be exclusive to humans for long. MIT researchers developed a technique called Self Adapting Language Models (SEAL) that lets LLMs adjust their own parameters as they learn. The approach boosted the performance of Meta\\\\u2019s Llama and Alibaba\\\\u2019s Qwen, although pushing the models too much can actually lead them to start forgetting things.\\\\n\\\\nFROM THE FRONTIER\\\\nAI is fueling a \\\\u2018solopreneur\\\\u2019 boom\\\\n\\\\nAI is getting so good, it can now replace real-life hosts. Source: CNBC/Screenshot\\\\n\\\\nA solo developer just sold his six-month-old \\\\u2018side-project\\\\u2019 for $80M: Maor Shlomo\\\\u2019s vibe-coding platform Base44, which helps non-programmers design their own software, was acquired by Wix as it looks to add more AI features to its website-building platform.\\\\n\\\\nWhile Shlomo\\\\u2019s startup didn\\\\u2019t stay \\\\u201csolo\\\\u201d for long (it eventually grew to include nine employees in total), its rate of growth and profitability, generating $189,000 of profit in May alone, would have been unheard of even a couple of years ago.\\\\n\\\\nAnother surprising application: Two AI avatars, trained on a real-life influencer and his co-host in China, just raised $7.65M in just seven hours via a livestream where they showed off different products. That\\\\u2019s allegedly more than the real-life hosts had managed during previous streams.\\\\n\\\\nThe big takeaway: AI is making startups smaller and smaller, as founders start to hand off increasingly complex tasks to agents. It\\\\u2019s to the point where a solo unicorn \\\\u2014 a single-person startup with at least a $1B valuation \\\\u2014 doesn\\\\u2019t sound quite so far-fetched anymore. To keep up, bigger corporations will need to carve out small, nimble teams where employees can experiment and put AI to use in unexpected ways.\\\\n\\\\nAI ACADEMY\\\\nHow to generate ChatGPT images in WhatsApp\\\\n\\\\nOpen WhatsApp on your phone.\\\\n\\\\nSend the message \\\\u201cLink my WhatsApp with ChatGPT\\\\u201d to 1-800-ChatGPT.\\\\n\\\\nYou\\\\u2019ll receive a link\\\\u2014tap it to connect your WhatsApp with your ChatGPT account\\\\n\\\\nNow you can prompt ChatGPT within WhatsApp to generate images for you.\\\\n\\\\nSample Prompt: Can you create me a white fluffy cat made of rice wrapped in a strip of seaweed around its stomach\\\\n\\\\nWait a few seconds, and ChatGPT will generate an image for you.\\\\n\\\\nIN THE KNOW\\\\nWhat\\\\u2019s trending on socials and headlines today\\\\n\\\\nWatch what happened when a UCLA graduate showed off all his ChatGPT-generated final projects during his graduation ceremony.\\\\n\\\\n\\\\u265f\\\\ufe0f Masterful Move: Duolingo built a full chess course from scratch with just two employees and the AI coding tool Cursor. Here\\\\u2019s how.\\\\n\\\\n\\\\ud83d\\\\udd01 Mother Lode: This mega-thread of X users sharing their coolest model context protocol (MCP) integrations is a goldmine of good ideas.\\\\n\\\\n\\\\ud83d\\\\udd75\\\\ufe0f The Plot Thickens: Are all LLMs converging around the same personality and responses? OpenAI cofounder Andrej Karpathy is on the case.\\\\n\\\\n\\\\ud83e\\\\udd2b Paper Trail: Two nonprofits just released a huge trove of documents that supposedly reveal some of OpenAI\\\\u2019s biggest secrets. Podcast host Rob Wiblin rounded up the most shocking details, although skeptics are already calling them into question.\\\\n\\\\nOpenAI is rolling out Record Mode, which can transcribe and summarize your meetings and thoughts, for all Pro, Enterprise, and Edu users.\\\\n\\\\nPerplexity will now let you generate videos with text prompts when you tag \\\\u201c@AskPerplexity\\\\u201d on X. Here\\\\u2019s a thread with some user-submitted examples.\\\\n\\\\nResearchers at OpenAI say they\\\\u2019ve spotted certain \\\\u201cinternal patterns\\\\u201d similar to brain activity that flare up before a model misbehaves \\\\u2014 a breakthrough that could help us build safer LLMs in the future.\\\\n\\\\nPROMPT STATION\\\\nLinkedIn Profile Optimizer\\\\nPrompt: <Role>\\\\nYou are a top LinkedIn Profile Strategist who helps professionals turn average profiles into powerful tools for career growth, visibility, and credibility. <Role>\\\\n\\\\n<Context>\\\\nWith 95% of recruiters using LinkedIn and just 7\\\\u201315 seconds spent scanning a profile, a strong profile can unlock major opportunities. Most professionals fail to stand out or clearly communicate their value. <Context>\\\\n\\\\n<Instructions> Ask the user to share:\\\\nCurrent headline\\\\nAbout/summary section\\\\nExperience descriptions\\\\nSkills section\\\\nRecent content/activity\\\\nCurrent goals\\\\nTarget audience (recruiters, clients, peers, etc.)\\\\n\\\\nThen, perform a detailed audit and provide:\\\\nHeadline Transformation \\\\u2013 3 keyword-optimized, high-impact alternatives\\\\nSummary Rewrite \\\\u2013 Rewritten using the Hook\\\\u2013Story\\\\u2013Offer framework\\\\nExperience Entry Fix \\\\u2013 Convert one duty-based entry into a results-driven version\\\\nSkills & Endorsements \\\\u2013 Optimization strategy for relevance and credibility\\\\nContent Strategy \\\\u2013 30-day calendar with 5 viral post ideas\\\\n\\\\nAlso include:\\\\nImplementation Priority Guide \\\\u2013 Steps in order of impact\\\\nPerformance Metrics \\\\u2013 Track views, search appearances, and engagement <Instructions>\\\\n\\\\n<Constraints> Keep suggestions tailored, actionable, and authentic. Avoid vague advice or unrealistic claims. Don\\\\u2019t request private info beyond LinkedIn content. <Constraints>\\\\n\\\\n<Output_Format>\\\\nLINKEDIN PROFILE AUDIT\\\\n\\\\nCurrent Profile Strengths\\\\nCritical Improvement Areas\\\\nStrategic Recommendations (items 1\\\\u20135 above)\\\\nImplementation Priority Guide\\\\nPerformance Measurement <Output_Format>\\\\n\\\\n<User_Input> Ask the user for the 7 LinkedIn details listed above before starting your audit. <User_Input>\\"},{\\"title\\": \\"Veo dethroned by Chinese rivals\\",\\"url\\": null,\\"content\\": \\"Welcome back, Superhuman. OpenAI wants out. A new report suggests its once unshakeable partnership with Microsoft could be in jeopardy. Plus: A surprise video model leaps past Veo 3, and Adobe has a plan to help companies boost their visibility on AI chatbots and browsers.\\\\n\\\\nAlso today: Learn how to automate your web browsing with AI, and get the latest AI tools and trending social media posts.\\\\n\\\\nTODAY IN AI\\\\n\\\\nByteDance\\\\u2019s Seedance model just claimed the top spot in a popular benchmark.\\\\n\\\\n1. Two new video models jump past Veo 3 on major benchmark: Since Google\\\\u2019s Veo 3 release last month, it\\\\u2019s been the undisputed champion of VLMs \\\\u2014 even making its way to primetime TV spots and Hollywood-backed short films. But its lead didn\\\\u2019t last for long: Artificial Analysis\\\\u2019 crowd-sourced leaderboard just ranked ByteDance\\\\u2019s Seedance 1.0 ahead of Veo across multiple categories. Meanwhile, MiniMax just revealed that a mysterious VLM known as \\\\u201cKangaroo,\\\\u201d which beats Veo in image-to-video, is actually a brand-new model called Hailuo 02. The shakeup proves that Chinese AI companies are managing to stay competitive with their US counterparts.\\\\n\\\\n2. TikTok unveils new AI video tools: ByteDance just gave marketers an entirely new way to promote their products on TikTok. Advertisers can now generate five-second clips with either text or image prompts, then stitch them together to \\\\u201cbring a full product catalog to life.\\\\u201d For example, you can upload an image of a car, and then generate a video of it driving through a desert landscape. You can also prompt AI avatars to talk about your product and show it off, or even model your brand\\\\u2019s clothing.\\\\n\\\\n3. Adobe is helping brands brace for AI\\\\u2019s search shakeup: Retail sites saw a staggering 3,500% spike in traffic coming from generative AI sources in the past year. But while consumers are quickly embracing chatbot-based shopping, analytics tools have struggled to keep up. Adobe\\\\u2019s new LLM Optimizer aims to fix that \\\\u2014 helping companies track how their content performs across AI platforms. It also boosts discoverability, sort of like SEO for LLMs, so your products are more likely to surface in AI-driven searches.\\\\n\\\\nFROM THE FRONTIER\\\\nReport: Microsoft and OpenAI face a bitter breakup\\\\n\\\\nOpenAI and Microsoft\\\\u2019s close relationship could be souring. Source: Analytics India Magazine\\\\n\\\\nIt looks like Microsoft and OpenAI\\\\u2019s six-year partnership \\\\u2014 one of the closest collaborations in the industry \\\\u2014 might have finally reached a tipping point.\\\\n\\\\nIt was a match made in heaven: As far back as 2019, Microsoft has been giving OpenAI cloud access and billions in investments in exchange for exclusive rights to the ChatGPT-maker\\\\u2019s models. But now that OpenAI has become a massively successful tech company in its own right, it wants more independence and flexibility.\\\\n\\\\nHow so? OpenAI has been trying for months to transform into a public-benefit corporation, giving it a chance to turn a profit and accelerate its growth. The one thing holding it back: Microsoft won\\\\u2019t budge on the details out of fear it\\\\u2019ll get burned in the process.\\\\n\\\\nHigh Stakes: According to the Wall Street Journal, the feud has gotten so heated that OpenAI is now considering going public with its accusations. It could also ask the federal government to investigate Microsoft for antitrust violations.\\\\n\\\\nNot so fast: In a joint statement, both companies agreed they\\\\u2019re \\\\u201coptimistic we will continue to build together for years to come,\\\\u201d hinting that there might still be time to smooth things over.\\\\n\\\\nAI & TECH NEWS\\\\nEverything else you need to know today\\\\n\\\\nA team of researchers used GPT-4.1 and o3-mini-high to shave off years of research time. Source: Imagen\\\\n\\\\n\\\\ud83d\\\\udcca Hype Train: Reddit launched a pair of AI tools that let advertisers track what\\\\u2019s trending in different subreddits and test-drive new campaigns before rolling them out on the platform.\\\\n\\\\n\\\\ud83d\\\\udd0d Data Dash: Researchers from Harvard, MIT, and other institutions reportedly saved the equivalent of 12 years of work by using OpenAI\\\\u2019s GPT-4.1 and o3-mini-high to automate a systematic review of medical research.\\\\n\\\\n\\\\ud83d\\\\udcf1 Price of Progress: Meta is bringing ads to WhatsApp\\\\u2019s \\\\u201cUpdates\\\\u201d tab, which gets around 1.5B visitors per day, as the social media giant races to recoup the $14.3B it recently invested in Scale AI.\\\\n\\\\n\\\\ud83d\\\\udcac Missing Link: ElevenLabs now supports MCP (model context protocol), meaning you can now build voice agents that connect to Salesforce, HubSpot, and Gmail without any setup.\\\\n\\\\nSOCIAL SIGNALS\\\\nWhat\\\\u2019s trending on socials today\\\\n\\\\nClick to see how a Redditor created a concept for a Ghibli-style video game.\\\\n\\\\n\\\\ud83d\\\\udcda Takes a Village: Anthropic just revealed how it built its own multi-agent research system, which \\\\u201cbeat single agents by up to 90%+ on some complex tasks.\\\\u201d AI builder Elvis Saravia has some highlights if you don\\\\u2019t have time to read the whole thing.\\\\n\\\\n\\\\ud83d\\\\udc0a Cold-Blooded Content: A viral post claims Anthropic is sponsoring an albino alligator named Claude at the California Academy of Sciences. There\\\\u2019s even a livestream where you can watch Claude \\\\u201cas he lounges, swims, and snoozes\\\\u201d in his swamp.\\\\n\\\\n\\\\ud83c\\\\udfa7 Sound of Success: Clever TikTok users are allegedly racking up tens of millions of followers by creating ASMR videos \\\\u2014 like slicing through glass fruits and molten lava \\\\u2014 using Veo 3\\\\u2019s new native audio features.\\\\n\\\\n\\\\ud83e\\\\uddd1\\\\u200d\\\\ud83d\\\\u...\n  "mcp_response_type": "earnlayer_content_ads_search",\n  "mcp_response_id": "bab7c628-09b5-47e3-80a8-5fa95fefc18a"\n}	f	2025-07-11 17:31:35.522289+00
