aa72b095-85ed-4d2f-aa3c-9b4cfff11f3d	83595b3f-6f66-42f5-9845-bedd7b94d54c	AIContinuousRapidEvolution	AI Continues Rapid Evolution: From Healthcare to Cybersecurity, Latest Developments Unfold\nThe past few days have seen a flurry of activity in the world of Artificial Intelligence, with breakthroughs and significant advancements emerging across diverse sectors. From innovative applications in healthcare and education to pressing concerns around security and ethical considerations, AI continues its relentless march forward, reshaping industries and prompting important societal discussions.\n\nOne of the most notable stories centers on the rapid adoption of AI by the U.S. Food and Drug Administration (FDA). The agency has launched "INTACT," its first agency-wide AI tool, designed to enhance operational efficiency, streamline regulatory processes, and improve risk assessment. This marks a significant step towards AI-driven government transformation, demonstrating a commitment to leveraging AI for public service.\n\nHowever, the proliferation of AI also brings new challenges. Cybersecurity researchers have raised alarms about new malicious AI variants based on WormGPT, including strains built on popular models like Grok and Mixtral. These tools are being weaponized to automate phishing attacks and malware creation with advanced precision, highlighting the urgent need for stronger AI safety and security protocols.\n\nEducation is another area witnessing significant AI integration. Mississippi has partnered with Nvidia to launch a statewide AI education initiative for middle and high school students, aiming to prepare the next generation for technology careers. Similarly, Google continues its investment in AI for education, offering free access to tools like Gemini Advanced for college students and expanding AI literacy programs.\n\nBeyond government and education, individual achievements are also making headlines. A remarkable example is 16-year-old Pranjali Awasthi, who founded Delv.AI, a $12 million AI research startup focused on making academic data more accessible with Large Language Models (LLMs). Her inspiring story underscores the potential for young innovators to contribute significantly to the AI landscape.\n\nOn the ethical front, Wikipedia editors are pushing back against the increasing use of AI-generated content on the platform, citing concerns about accuracy, tone, and proper citation. This backlash reflects broader tensions between human moderation and machine-generated information, prompting discussions about maintaining quality and trustworthiness in the age of AI. Even religious leaders are weighing in, with Pope Leo XIV expressing concerns about AI's impact on youth development and urging developers to embed human dignity in AI design.	2025-06-22 14:48:18.95383+00	2025-06-22 14:48:18.95383+00	\N	published
ae00e582-ef85-4170-978c-56034e68108e	83595b3f-6f66-42f5-9845-bedd7b94d54c	The Evolving Landscape of AI Regulation	The Evolving Landscape of AI Regulation: A Global Shift Towards Economic Harness\nToronto, ON  June 22, 2025  The global conversation around Artificial Intelligence (AI) regulation is undergoing a significant pivot, moving away from an exclusive focus on safety and warnings towards a more concerted effort to harness AI's economic benefits. This shift was underscored by Canada's new Minister of Artificial Intelligence and Digital Innovation, Evan Solomon, in a recent address, signalling a broader trend among nations.\n\nMinister Solomon, in his inaugural speech, emphasized that Canada will no longer "over-index on warnings and regulation," but instead prioritize ways to maximize the economic advantages offered by AI. While acknowledging the need to protect data and privacy, he suggested that a rigid, singular approach to AI regulation is impractical given the rapid pace of technological development and the varying interests of global players. "The United States and China have no desire to buy into any constraint or regulation," Solomon stated, highlighting the challenges of unilateral regulatory efforts.\n\nThis sentiment echoes a broader shift observed internationally. The initial global summits on AI safety, which heavily emphasized existential risks, are giving way to forums with a wider scope, now encompassing adoption strategies and economic integration. For instance, the recent AI Action Summit in Paris saw a distinct pushback against overly restrictive European regulatory efforts from the US Vice-President.\n\nCanada's new approach aims to foster its domestic AI industry, drive adoption across various sectors, and ensure Canadian trust and sovereignty over the technology. This includes government investments in data centers and research, intellectual property protection, and a strong focus on commercialization. The goal is to champion Canadian AI companies and encourage small and medium-sized enterprises to embrace AI, positioning the country to lead in this "Guttenberg moment" of technological revolution.\n\n\nWhile the need for ethical guidelines and safeguards remains, particularly concerning data protection and privacy, the overarching message from many governments is clear: the future of AI lies in defining, shaping, and leading its transformative potential for economic growth and innovation, rather than solely attempting to constrain it.	2025-06-22 14:48:18.95383+00	2025-06-22 14:48:18.95383+00	\N	published
1999b932-5654-431b-b16f-7e0fef928c8d	bab7c628-09b5-47e3-80a8-5fa95fefc18a	Gemini 2.5 unleashed	Welcome back, Superhuman. You can now apparently build a lightweight Netflix clone with nothing more than an AI agent and some well-crafted prompts. And: Tech CEOs are finally starting to admit what weve all suspected: AI is coming for some of our jobs  but it might unlock even better opportunities in the process.\n\nAlso today: Learn how to create product videos with Higgsfield, and get the latest AI tools, prompts, and trending social media posts.\n\nTODAY IN AI\n\nAdobe is rolling out a series of new AI-powered updates for Firefly. Source: Adobe\n\n1. Google drops major Gemini 2.5 updates: The search giant revealed that Gemini 2.5 Pro, its most powerful model, is now out of preview and all set for developers to build on. The same is true for its smaller sibling, Gemini 2.5 Flash, which is designed for fast all-around help. Finally, a new model called 2.5 Flash-Lite is even speedier while beating its predecessor across math, science, and coding. It can also be assigned different thinking budgets if you want it to take on more complex tasks without jumping to the full Flash model.\n\n2. Open-source agent leaps to the front of the pack: Shanghais MiniMax just released a new model called M1 that features an enormous 1M-token context window  theoretically big enough to process an entire collection of books, compared to GPT-4os novel-length limit. It also edges out DeepSeeks R1, despite that model getting a major upgrade only a few weeks ago. And it can supposedly handle everything from building a Netflix clone to whipping up a stock dashboard on its own.\n\n3. New mobile app unlocks on-the-go video generations: Adobe just unveiled a mobile version of Firefly, its commercially-safe image and video generation platform. Its also rolling out Boards, an AI-powered digital mood board that can help you piece together creative ideas  now with video-gen folded in. Plus, you can access just about every major third-party video and image model inside Firefly, including newcomers from Luma, Runway, and Ideogram, as well as staples from Google and OpenAI.\n\nFROM THE FRONTIER\nAI is already reshaping the workplace\n\nNearly 20% of American workers use AI on a frequent basis. Source: Gallup\n\nThe USs second-largest employer just dropped the hammer. In a new memo to his 1.5M+ employees, Amazon CEO Andy Jassy revealed that the company will likely see some job cuts in the near future as generative AI floods virtually every corner of the company.\n\nBut its not as grim as it sounds: Jassy said that while some positions are bound to be automated, other types of jobs will open up. Some of the best ways to prepare: Be curious about AI, educate yourself, attend workshops and take trainings, use and experiment with AI whenever you can, participate in your teams brainstorms.\n\nA new Gallup poll suggests many of us are already well on our way: About 40% of American employees have used AI at least a few times in the past year, up from just 21% the year before. Meanwhile, nearly one in five employees count themselves as frequent AI users, relying on LLMs at least a few times a week for work. (A new Microsoft report has some tips to help ease the transition.)\n\nWhat it means: In the past few months, weve finally seen CEOs be more upfront about AIs impact on jobs. While that transparency can be daunting, its also an exciting time for the workforce. We have an active role in reshaping our daily workflows and can proactively create the jobs we envision.\n\nAI & TECH NEWS\nEverything else you need to know today\n\nKreas new image model breaks new ground in the photorealism department. Source: Krea\n\n Sharper Image: AI creator platform Krea is giving everyone access to its new image model, Krea 1, which can generate photorealistic shots while avoiding the typical AI look that affects its competitors. You can try it here.\n\n Ultra Upsell: Cursor unveiled a new $200/month Ultra plan that gives power users 20x the usage of its $20/month Pro tier. The move could help parent company Anysphere boost revenue following its $9.9B valuation earlier this month.\n\n Text-to-Image: You can now generate images by sending a prompt to 1-800-ChatGPT inside WhatsApp. Plus, OpenAI is bringing reusable prompts to the API, letting you easily reuse, share, save, and manage your prompts  or even optimize them with the click of a button.\n\n Clear Vision: Meta and glasses-maker EssilorLuxottica are teaming up with Oakley and Prada to create spin-offs of their AI-powered smart glasses. Oakleys version will reportedly cost $360, featuring new weather resistance upgrades, while the Prada variant is still under wraps.	2025-06-22 14:48:51.0138+00	2025-06-22 14:48:51.0138+00	\N	published
ee5ef0c7-3423-4666-9861-1211e43391fd	bab7c628-09b5-47e3-80a8-5fa95fefc18a	Midjourney video model is finally here	Welcome back, Superhuman. Its finally here. If youve been dabbling in AI image generation since the early days, you probably know that Midjourney is a fan favorite. But other AI labs have beaten Midjourney to video models over the last year. The companys long-awaited video model is here at long last  and packs a serious punch.\n\nAlso: Sam Altman makes some big allegations, Meta continues its spending splurge, and learn how to find hidden insights with todays prompt.\n\nTODAY IN AI\n\nClick here to watch Midjourneys new video generation model V1 in action. Source: Midjourney\n\n1. Midjourney launches its first AI video generation model: The startup just dropped V1, which lets you turn any image into a set of 4 five-second video clips. The model can extend clips up to 21 seconds and allows users to tweak camera movement and animation styles. At $10/month, its significantly cheaper than other video generation models in the space, and according to Wharton professor Ethan Mollick, it can generate video styles that are hard to achieve with other video creation tools.\n\n2. Sam Altman drops GPT-5 timeline: In a podcast interview, the OpenAI CEO shared that GPT-5 is coming probably sometime this summer. The model is expected to come with enhanced reasoning and agentic capabilities. Altman also alleged that Elon Musk tried to use his influence in government to compete unfairly against OpenAI. In a separate interview, Altman also claimed that Meta is offering OpenAIs top employees $100M bonuses to lure them away.\n\n3. Meta reportedly continues its aggressive talent acquisition spree: Not to be deterred by allegations of $100M pay packages, the social media giant is reportedly courting former GitHub CEO Nat Friedman and investor Daniel Gross to join its leadership team. Meta may also potentially buy out part of their venture fund NFDG. The duo has backed major AI startups like Perplexity, Eleven Labs, and Safe Superintelligence.\n\nIN THE KNOW\nWhats trending on socials and headlines today\n\n Brain Drain: MIT just ran a study that measures the effects of ChatGPT on student brains and the results dont look great.\n\n Reality Check: Someone asked ChatGPT the top 10 things humanity should know and put the chatbots response up on Reddit in a post that has since blown up.\n\n Reality Filter: A ChatGPT and Gemini user claims to have created a prompt that stops these chatbots from hallucinating and gaslighting you.\n\n Builders Delight: Andrej Karpathy's keynote at YCs AI Startup School is blowing up. Its a must-watch if youre building with AI.\n\nGoogle just dropped a new Search Live feature for its AI mode, letting you hold full conversations and chat back and forth with search results. Users can now ask follow-up questions out loud and get AI-generated audio responses in return.\n\nHiggsfield AI launched Canvas, a new image editing model that lets users paint products directly onto photos. Handy for marketers, designers, and creators.\n\nOpenAI is rolling out "Record Mode" for ChatGPT Pro users, allowing you to record, transcribe, and summarize your meetings. The feature is available on the macOS desktop app.\n\n	2025-06-22 14:48:51.0138+00	2025-06-22 14:48:51.0138+00	\N	published
4e925be1-e07f-4810-875e-345fbda048b9	bab7c628-09b5-47e3-80a8-5fa95fefc18a	Robotics Special Waymo eyes the Big Apple	Robotics Special: Waymo eyes the Big Apple\n\nWelcome back, Superhuman. Researchers in Italy dropped the worlds first flying humanoid robot this week. And robotaxis are looking to gradually expand their footprint across the US, with Alphabet-owned Waymo now eying a move to the Big Apple.\n\nP.S. The Robotics Special is designed to help you stay on the cutting edge of the latest breakthroughs and products in the industry. Our regular AI and Tech updates will resume as usual on Monday.\n\nThe most important news and breakthroughs in robotics this week\n\nClick here to watch the worlds first flying humanoid robot lift off the ground. Source: Italian Institute of Technology\n\n1. Waymos self-driving cars might make their way to NYC: The company has put in an application to test its driverless cars in New York City  one of the first autonomous vehicle (AV) companies to request approval for testing in the notoriously chaotic streets of Manhattan. The robotaxi company would initially operate with trained specialists behind the wheel since state law doesn't allow fully autonomous drives yet. The move comes as Tesla prepares to kick off its limited robotaxi operations in Austin.\n\n2. Hexagon taps Nvidia Robotics to deploy its humanoid robot: The company has unveiled AEON, a humanoid robot built with Nvidias simulation platform for manufacturing and logistics tasks. The industrial bot hopes to tackle critical labor shortages by performing reality capture  automatically scanning assets and environments to generate precise 3D models. Using Nvidias Omniverse platform, AEON mastered core locomotion skills in just 2-3 weeks instead of the typical 5-6 months.\n\n3. Researchers claim theyve built the first flying humanoid robot : Italian researchers have unveiled the iRonCub3, a jet-powered humanoid robot that they claim successfully hovered to about 50cm off the ground during its first test flight. Not exactly breaking altitude records, but still a significant leap. Unlike traditional drones, the robot must balance an entire humanoid body with movable limbs while adapting to complex, ever-changing aerodynamics. See it in action here.\n\nROBOTS IN ACTION\nHow robots are transforming the world around us\n\nDr. Kenneth Liao performs the first successful, fully robotic heart transplant in the US. Source: Baylor College of Medicine\n\nHeart Hack: Houston surgeons have performed the first fully robotic heart transplant in the US without cracking open the patient's chest. Instead of the traditional method of breaking the breastbone, doctors made small incisions in the abdomen, using robotic tools to remove the diseased heart and implant a donor organ.\n\nGas Guardian: A single undetected gas leak can cost facilities over $57,000 per year and pose a major safety risk in petrochemical plants. Now, Swiss robotics company ANYbotics has equipped its ANYmal robot with gas leak detection capabilities, enabling the quadruped to pinpoint invisible leaks that manual inspections often miss.\n\nBlade Runner: KUKA has unveiled the Catonator, a remote-controlled robotic saw armed with 2,000mm blades that can slice through steel, concrete, and aerospace composites with 0.1mm precision. It could potentially automate precision cutting tasks while eliminating emissions and improving worker safety in heavy industry applications.\n\nINDUSTRY SNAPSHOT\nEverything else you need to know this week\n\nSource: Reuters\n\nHere are the biggest developments in the robotics space that you should know about:\n\nTesla has been asked by Democratic lawmakers to put off its robotaxi launch until September, when new regulations with stricter state oversight take effect.\n\nAnduril is joining hands with German giant Rheinmetall to build military drones for European markets  a shift toward faster innovation in European defense.\n\nA recent Gallup poll shows that 15% of US workers believe that AI or robots may likely replace their jobs.\n\nAmazon's Zoox just opened its first production facility in Hayward, California, where it eventually expects to build over 10,000 electric AVs annually.\n\nEngineAI has open-sourced a dev suite designed to accelerate humanoid robot creation by removing technical barriers for startups and researchers.\n\nUS startup Skydweller Aero has partnered up with French defense company Thales to deploy a solar-powered drone that can stay in flight for a whole month.\n\nPrismaX has launched with $11M to solve one of the biggest bottlenecks in robotics  a lack of high-quality training data for AI models.\n\nROBOT OF THE WEEK\nA robot that caught our eye this week\n\nSource: Beatbot\n\nBeatbots AquaSense 2 is making waves as a Roomba for your swimming pool.\n\nThe robotic pool cleaner uses HybridSense AI mapping, 27 sensors, and 11 motors to clean floors, walls, waterlines, and the water surface automatically while also offering water clarification. It can take on pools up to 3,875 square feet and runs for up to 10 hours on a single charge for surface cleaning.\n\nYou can check it out here.\n\nROBO REEL\nWatch: Inventor builds real-life Transformer that shape-shifts into a ride\n\nBruton's robot is a feat of practical engineering, designed with eagle-eyed detail. Source: James Bruton / YouTube\n\nIt was only a matter of time.\n\nIn what was every 90s kids childhood dream, British inventor James Bruton has built a rideable Transformer robot that actually shape-shifts from humanoid to vehicle. Unlike other transformer projects that leave no room for passengers, Bruton's creation can carry a human rider at functional speeds.	2025-06-22 14:48:51.0138+00	2025-06-22 14:48:51.0138+00	\N	published
a56e9a8f-5b9d-4c8f-aa5a-f8582dfff226	bab7c628-09b5-47e3-80a8-5fa95fefc18a	Tiny teams huge payoff	Welcome back, Superhuman. It might be time to change your password. Researchers claim theyve uncovered one of the largest data hacks ever recorded. If confirmed, itd mean up to 16B of our private credentials from platforms like Google and Apple might be compromised.\n\nAlso today: Learn how to generate ChatGPT images in WhatsApp, and get the latest AI tools and trending social media posts.\n\nTODAY IN AI\n\nMiniMax is going after rivals like OpenAI and Butterfly Effect with a browser-based agent. Source: MiniMax\n\n1. You can now try MiniMaxs general agent for yourself: The Alibaba-backed startup is bringing its models reasoning capabilities to the masses. MiniMax Agent lets you spin up coding projects, reports, and slideshows alongside an autonomous AI teammate that seems at least on par with fellow Chinese counterpart Manus. For inspiration, you can scroll down to see what others have created, like a London airspace tracker, a virtual museum tour, and an SEO dashboard  complete with the prompts they used.\n\n2. Little-known startup races to fill Scale AI-shaped hole: With Meta purchasing a 49% stake in Scale and major players like OpenAI and Google heading for the door, an obscure startup called Surge AI is stepping out of the shadows as a worthy replacement. Like Scale, the 110-person company labels data for training frontier models. But it brought in $1B last year, fully bootstrapped, while $29B-valued Scale made only $870M in the same period. Surge is just one of a growing number of data-labeling startups that could stand to benefit from the Scale shakeup.\n\n3. MIT builds model that can continually teach itself: One thing that separates us from AI is that we have the ability to pick up new information and adjust our worldview accordingly. But that skill might not be exclusive to humans for long. MIT researchers developed a technique called Self Adapting Language Models (SEAL) that lets LLMs adjust their own parameters as they learn. The approach boosted the performance of Metas Llama and Alibabas Qwen, although pushing the models too much can actually lead them to start forgetting things.\n\nFROM THE FRONTIER\nAI is fueling a solopreneur boom\n\nAI is getting so good, it can now replace real-life hosts. Source: CNBC/Screenshot\n\nA solo developer just sold his six-month-old side-project for $80M: Maor Shlomos vibe-coding platform Base44, which helps non-programmers design their own software, was acquired by Wix as it looks to add more AI features to its website-building platform.\n\nWhile Shlomos startup didnt stay solo for long (it eventually grew to include nine employees in total), its rate of growth and profitability, generating $189,000 of profit in May alone, would have been unheard of even a couple of years ago.\n\nAnother surprising application: Two AI avatars, trained on a real-life influencer and his co-host in China, just raised $7.65M in just seven hours via a livestream where they showed off different products. Thats allegedly more than the real-life hosts had managed during previous streams.\n\nThe big takeaway: AI is making startups smaller and smaller, as founders start to hand off increasingly complex tasks to agents. Its to the point where a solo unicorn  a single-person startup with at least a $1B valuation  doesnt sound quite so far-fetched anymore. To keep up, bigger corporations will need to carve out small, nimble teams where employees can experiment and put AI to use in unexpected ways.\n\nAI ACADEMY\nHow to generate ChatGPT images in WhatsApp\n\nOpen WhatsApp on your phone.\n\nSend the message Link my WhatsApp with ChatGPT to 1-800-ChatGPT.\n\nYoull receive a linktap it to connect your WhatsApp with your ChatGPT account\n\nNow you can prompt ChatGPT within WhatsApp to generate images for you.\n\nSample Prompt: Can you create me a white fluffy cat made of rice wrapped in a strip of seaweed around its stomach\n\nWait a few seconds, and ChatGPT will generate an image for you.\n\nIN THE KNOW\nWhats trending on socials and headlines today\n\nWatch what happened when a UCLA graduate showed off all his ChatGPT-generated final projects during his graduation ceremony.\n\n Masterful Move: Duolingo built a full chess course from scratch with just two employees and the AI coding tool Cursor. Heres how.\n\n Mother Lode: This mega-thread of X users sharing their coolest model context protocol (MCP) integrations is a goldmine of good ideas.\n\n The Plot Thickens: Are all LLMs converging around the same personality and responses? OpenAI cofounder Andrej Karpathy is on the case.\n\n Paper Trail: Two nonprofits just released a huge trove of documents that supposedly reveal some of OpenAIs biggest secrets. Podcast host Rob Wiblin rounded up the most shocking details, although skeptics are already calling them into question.\n\nOpenAI is rolling out Record Mode, which can transcribe and summarize your meetings and thoughts, for all Pro, Enterprise, and Edu users.\n\nPerplexity will now let you generate videos with text prompts when you tag @AskPerplexity on X. Heres a thread with some user-submitted examples.\n\nResearchers at OpenAI say theyve spotted certain internal patterns similar to brain activity that flare up before a model misbehaves  a breakthrough that could help us build safer LLMs in the future.\n\nPROMPT STATION\nLinkedIn Profile Optimizer\nPrompt: <Role>\nYou are a top LinkedIn Profile Strategist who helps professionals turn average profiles into powerful tools for career growth, visibility, and credibility. <Role>\n\n<Context>\nWith 95% of recruiters using LinkedIn and just 715 seconds spent scanning a profile, a strong profile can unlock major opportunities. Most professionals fail to stand out or clearly communicate their value. <Context>\n\n<Instructions> Ask the user to share:\nCurrent headline\nAbout/summary section\nExperience descriptions\nSkills section\nRecent content/activity\nCurrent goals\nTarget audience (recruiters, clients, peers, etc.)\n\nThen, perform a detailed audit and provide:\nHeadline Transformation  3 keyword-optimized, high-impact alternatives\nSummary Rewrite  Rewritten using the HookStoryOffer framework\nExperience Entry Fix  Convert one duty-based entry into a results-driven version\nSkills & Endorsements  Optimization strategy for relevance and credibility\nContent Strategy  30-day calendar with 5 viral post ideas\n\nAlso include:\nImplementation Priority Guide  Steps in order of impact\nPerformance Metrics  Track views, search appearances, and engagement <Instructions>\n\n<Constraints> Keep suggestions tailored, actionable, and authentic. Avoid vague advice or unrealistic claims. Dont request private info beyond LinkedIn content. <Constraints>\n\n<Output_Format>\nLINKEDIN PROFILE AUDIT\n\nCurrent Profile Strengths\nCritical Improvement Areas\nStrategic Recommendations (items 15 above)\nImplementation Priority Guide\nPerformance Measurement <Output_Format>\n\n<User_Input> Ask the user for the 7 LinkedIn details listed above before starting your audit. <User_Input>	2025-06-22 14:48:51.0138+00	2025-06-22 14:48:51.0138+00	\N	published
a9ea0fab-f464-4ef6-91b5-99c7ffc09614	bab7c628-09b5-47e3-80a8-5fa95fefc18a	Veo dethroned by Chinese rivals	Welcome back, Superhuman. OpenAI wants out. A new report suggests its once unshakeable partnership with Microsoft could be in jeopardy. Plus: A surprise video model leaps past Veo 3, and Adobe has a plan to help companies boost their visibility on AI chatbots and browsers.\n\nAlso today: Learn how to automate your web browsing with AI, and get the latest AI tools and trending social media posts.\n\nTODAY IN AI\n\nByteDances Seedance model just claimed the top spot in a popular benchmark.\n\n1. Two new video models jump past Veo 3 on major benchmark: Since Googles Veo 3 release last month, its been the undisputed champion of VLMs  even making its way to primetime TV spots and Hollywood-backed short films. But its lead didnt last for long: Artificial Analysis crowd-sourced leaderboard just ranked ByteDances Seedance 1.0 ahead of Veo across multiple categories. Meanwhile, MiniMax just revealed that a mysterious VLM known as Kangaroo, which beats Veo in image-to-video, is actually a brand-new model called Hailuo 02. The shakeup proves that Chinese AI companies are managing to stay competitive with their US counterparts.\n\n2. TikTok unveils new AI video tools: ByteDance just gave marketers an entirely new way to promote their products on TikTok. Advertisers can now generate five-second clips with either text or image prompts, then stitch them together to bring a full product catalog to life. For example, you can upload an image of a car, and then generate a video of it driving through a desert landscape. You can also prompt AI avatars to talk about your product and show it off, or even model your brands clothing.\n\n3. Adobe is helping brands brace for AIs search shakeup: Retail sites saw a staggering 3,500% spike in traffic coming from generative AI sources in the past year. But while consumers are quickly embracing chatbot-based shopping, analytics tools have struggled to keep up. Adobes new LLM Optimizer aims to fix that  helping companies track how their content performs across AI platforms. It also boosts discoverability, sort of like SEO for LLMs, so your products are more likely to surface in AI-driven searches.\n\nFROM THE FRONTIER\nReport: Microsoft and OpenAI face a bitter breakup\n\nOpenAI and Microsofts close relationship could be souring. Source: Analytics India Magazine\n\nIt looks like Microsoft and OpenAIs six-year partnership  one of the closest collaborations in the industry  might have finally reached a tipping point.\n\nIt was a match made in heaven: As far back as 2019, Microsoft has been giving OpenAI cloud access and billions in investments in exchange for exclusive rights to the ChatGPT-makers models. But now that OpenAI has become a massively successful tech company in its own right, it wants more independence and flexibility.\n\nHow so? OpenAI has been trying for months to transform into a public-benefit corporation, giving it a chance to turn a profit and accelerate its growth. The one thing holding it back: Microsoft wont budge on the details out of fear itll get burned in the process.\n\nHigh Stakes: According to the Wall Street Journal, the feud has gotten so heated that OpenAI is now considering going public with its accusations. It could also ask the federal government to investigate Microsoft for antitrust violations.\n\nNot so fast: In a joint statement, both companies agreed theyre optimistic we will continue to build together for years to come, hinting that there might still be time to smooth things over.\n\nAI & TECH NEWS\nEverything else you need to know today\n\nA team of researchers used GPT-4.1 and o3-mini-high to shave off years of research time. Source: Imagen\n\n Hype Train: Reddit launched a pair of AI tools that let advertisers track whats trending in different subreddits and test-drive new campaigns before rolling them out on the platform.\n\n Data Dash: Researchers from Harvard, MIT, and other institutions reportedly saved the equivalent of 12 years of work by using OpenAIs GPT-4.1 and o3-mini-high to automate a systematic review of medical research.\n\n Price of Progress: Meta is bringing ads to WhatsApps Updates tab, which gets around 1.5B visitors per day, as the social media giant races to recoup the $14.3B it recently invested in Scale AI.\n\n Missing Link: ElevenLabs now supports MCP (model context protocol), meaning you can now build voice agents that connect to Salesforce, HubSpot, and Gmail without any setup.\n\nSOCIAL SIGNALS\nWhats trending on socials today\n\nClick to see how a Redditor created a concept for a Ghibli-style video game.\n\n Takes a Village: Anthropic just revealed how it built its own multi-agent research system, which beat single agents by up to 90%+ on some complex tasks. AI builder Elvis Saravia has some highlights if you dont have time to read the whole thing.\n\n Cold-Blooded Content: A viral post claims Anthropic is sponsoring an albino alligator named Claude at the California Academy of Sciences. Theres even a livestream where you can watch Claude as he lounges, swims, and snoozes in his swamp.\n\n Sound of Success: Clever TikTok users are allegedly racking up tens of millions of followers by creating ASMR videos  like slicing through glass fruits and molten lava  using Veo 3s new native audio features.\n\n Beyond Buzzwords: LinkedIn cofounder Reid Hoffman just shared his advice for how to prepare for the AI wave, beyond just learning how to prompt engineer and vibe-code.\n\nPROMPT STATION\nSimplify and summarize long articles\nPrompt: You are a reading assistant. The user will provide you with an article to read. Please thoroughly read the article and generate a guide and a simplified, easy-to-read version of the article with the following requirements:\n\n## Your output:\n\nMind Map: First, generate a mind map for the entire guide.\n\nSummary: Next, provide a summary of the entire text, limited to 400 words.\n\nSimplified Article: Then, present your rewritten simplified and easy-to-read version of the article.\n\n## Requirements for Rewriting:\n\nWord Count: Compress the word count to half of the original, and ensure it does not exceed 3,000 words.\n\nAuthors Tone: Simulate the original author's tone.\n\nStructure: Maintain the original structure, retaining all levels of headings.\n\nFormatting: Format the output to ensure a visually appealing layout and ease of reading.\n\nVisual Elements: Insert tables, charts, diagrams, SVGs, and other visual elements in appropriate places to enhance readability.\n\nSource: r/ChatGPTPromptGenius	2025-06-22 14:48:51.0138+00	2025-06-22 14:48:51.0138+00	\N	published
